function getTranslate(text) {
  var number = getCookie("lang");
  if(!number){
    number = 0;
  }
  return lang[text][number];
}
function changeLang() {
  var number = getCookie("lang");
  $( ".lang" ).each(function() {
    var text = $(this).attr( "text" );
    if(lang[text]){
        $(this).text(lang[text][number]);
    }
  });
}
function setLang(number) {
  setCookie("lang", number, {"path": "/"});
  changeLang(number);
}

