function sendGet(url, callback){
  $.get(url)
  .done(function( data ) {
    if(callback){
      callback(data);
    }
  })
  .fail(function() {
    cl( "error" );
  });
}

function sendPost(url, data, callback){
  $.post(url, data)
    .done(function( data ) {
      if(callback){
        callback(data);
      }
    })
    .fail(function() {
      cl( "error" );
    });
}
function cl(m) {
  console.log(m);
}
