addEventListener("keyup", function(event) {
    var forword = 39;
    var backword = 37;
    var down = 40;
    var up = 38;
    var controlFF = 34;
    var controlBK = 33;
    if(event.keyCode == forword || event.keyCode == down || event.keyCode == controlFF){
      initNextSlide();
    }else if (event.keyCode == backword || event.keyCode == up || event.keyCode == controlBK) {
      initPrevSlide();
    }
});

function initNextSlide() {
  var flag1 = false;
  var elArr = $(".img-slide");
  $(elArr).each(function(i) {
    if(flag1){
      $(this).addClass('active');
      return false;
    }else{
      if($(this).hasClass('active')){
        if(i < elArr.length - 1){
          $(this).removeClass('active');
        }
        flag1 = true;
      }
    }
  });
}

function initPrevSlide() {
  var prevEl = false;
  $(".img-slide").each(function(i) {
      if($(this).hasClass('active')){
        if(i>0){
          $(this).removeClass('active');
          $(prevEl).addClass('active');
        }
        return false;
      }else{
        prevEl = this;
      }
  });
}

